// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ComplainantReport {
    struct Status {
        string status;
        uint timestamp;
        address updatedBy;
        string reason;
    }

    struct Report {
        uint id;
        string descriptionHash;
        address reporter;
        uint timestamp;
        Status[] statusHistory;
    }

    mapping(uint => Report) public reports;
    uint public reportCount;

    event ReportCreated(uint id, string descriptionHash, address reporter, uint timestamp);
    event StatusUpdated(uint id, string status, uint timestamp, address updatedBy, string reason);

    function createReport(string memory _descriptionHash) public {
        reportCount++;
        Report storage newReport = reports[reportCount];
        newReport.id = reportCount;
        newReport.descriptionHash = _descriptionHash;
        newReport.reporter = msg.sender;
        newReport.timestamp = block.timestamp;
        newReport.statusHistory.push(Status("Reported", block.timestamp, msg.sender, "Initial report"));
        emit ReportCreated(reportCount, _descriptionHash, msg.sender, block.timestamp);
    }

    function updateStatus(uint _id, string memory _status, string memory _reason) public {
        Report storage _report = reports[_id];
        require(_report.id != 0, "Report not found");
        _report.statusHistory.push(Status(_status, block.timestamp, msg.sender, _reason));
        emit StatusUpdated(_id, _status, block.timestamp, msg.sender, _reason);
    }

    function getReport(uint _id) public view returns (uint, string memory, address, uint, Status[] memory) {
        Report memory _report = reports[_id];
        return (_report.id, _report.descriptionHash, _report.reporter, _report.timestamp, _report.statusHistory);
    }
}
